script: |
  super -f text -I q5040.spq | sort > q5040.out

inputs:
  - name: q5040.spq
    data: |
      SELECT DISTINCT 8 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT - 38 NOT IN ( col0 / - col2 + - col0 - - + 0, - col2, 10, 21 * col0 / + 55, - - ( - 21 ) * 94, + + col2 );
  - name: tab0

outputs:
  - name: q5040.out
    data: |
